import React, { Component } from 'react';
import './Map.css';
import ReactGoogleMapLoader from "react-google-maps-loader";
import ReactGoogleMap from 'react-google-map';


export default class MapComponent extends Component {
    styles = [
        {
            "featureType": "landscape",
            "stylers": [
                {
                    "hue": "#FFA800"
                },
                {
                    "saturation": 0
                },
                {
                    "lightness": 0
                },
                {
                    "gamma": 1
                }
            ]
        },
        {
            "featureType": "road.highway",
            "stylers": [
                {
                    "hue": "#53FF00"
                },
                {
                    "saturation": -73
                },
                {
                    "lightness": 40
                },
                {
                    "gamma": 1
                }
            ]
        },
        {
            "featureType": "road.arterial",
            "stylers": [
                {
                    "hue": "#FBFF00"
                },
                {
                    "saturation": 0
                },
                {
                    "lightness": 0
                },
                {
                    "gamma": 1
                }
            ]
        },
        {
            "featureType": "road.local",
            "stylers": [
                {
                    "hue": "#00FFFD"
                },
                {
                    "saturation": 0
                },
                {
                    "lightness": 30
                },
                {
                    "gamma": 1
                }
            ]
        },
        {
            "featureType": "water",
            "stylers": [
                {
                    "hue": "#00BFFF"
                },
                {
                    "saturation": 6
                },
                {
                    "lightness": 8
                },
                {
                    "gamma": 1
                }
            ]
        },
        {
            "featureType": "poi",
            "stylers": [
                {
                    "hue": "#679714"
                },
                {
                    "saturation": 33.4
                },
                {
                    "lightness": -25.4
                },
                {
                    "gamma": 1
                }
            ]
        }
    ]
    render(){

        return(
            <div className="map-container">
            <ReactGoogleMapLoader
        params={{
            key: "AIzaSyD8UWoPDZssIjtLLe_ogggrymmRyrg_71E",
            libraries: "places,geometry",
        }}
        render={googleMaps =>
            googleMaps && (
                <div className="map-container"style={{height: "300px"}}>
                    <ReactGoogleMap

                        googleMaps={googleMaps}
                        center={{lat: 36.9915, lng: -119.7889}}
                        zoom={5}
                    />
                </div>
            )
        }
    />
    </div>
        )
    }
}
